function find_maximum_subset(nums) {
    var maximum_value = 0, answer = 0;
    for (var num of nums) {
        maximum_value |= num;
    }
    function depth_first_search(index, current_value) {
        if (index == nums.length) {
            if (current_value == maximum_value) {
                answer++;
            }
            return;
        }
        depth_first_search(index + 1, current_value);
        depth_first_search(index + 1, current_value | nums[index]);
    }
    depth_first_search(0, 0);
    return answer;
}
```
